import React from "react";
import StudentService from "./StudentService";

class InfoBox extends React.Component{


    constructor(props) {
        super(props);


    }

    updateHesCode=async ()=>
    {
        await StudentService.updateHesCode
    }

    render(){
        return (
            <>
                <div className='infoBox'> Name: {this.props.name}</div>
                <div className='infoBox'> Surname: {this.props.surname} </div>
                <div className='infoBox'> id: {this.props.id}</div>
                <div className='infoBox'>
                    Hes Code: {this.props.hesCode}
                    <button onClick={this.updateHesCode}> Update </button>
                </div>
                <></>
            </>
        );
    }

}

export default InfoBox
